import com.greensock.TweenMax;

function thrust(powerScale:int = 1):void {
	var thrustPower:Number;
	switch (powerScale) {
		case 1:
			thrustPower = 1;// was 1.1
			break;
		case 2:
			thrustPower = 1.15;// was 1.3
			break;
		case 3:
			thrustPower = 1.3;// was 1.5
			break;
		default:
			thrustPower = 1;//was 1.1
	}
	if (_parent.extraLundge) {
		thrustPower += .5;
	}

	_parent.xSpeed = _parent.xSpeed + ((_parent.maxMoveSpeed*thrustPower)*_parent.scaleX);
	TweenMax.delayedCall(4, function () {_parent.xSpeed *= .5;}, null, true);
}

